import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import Login from './pages/Login'; // Import the Login component

ReactDOM.render(
  <React.StrictMode>
    <App />
    <Login /> {/* Include the Login component */}
  </React.StrictMode>,
  document.getElementById('root')
);
